sections.code:
* {
    font-family: monaco;
    font-size: 14px;
}
body {
    margin: 0;
}
.votearrow {
    margin: 0 5px;
    margin-top: 13px;
    zoom: 1.3;
}
.rank {
    margin-left: 20px;
}
.title {
    padding-right: 10px;
    padding-top: 13px;
}
.storylink {
    font-size: 17px;
    margin-right: 10px;
}
.storylink:hover {
    color: #ef6437;
}
.subtext {
    padding-bottom: 10px;
    padding-top: 3px;
}
#hnmain {
    max-width: 900px;
}

.Box,
.State,
.Label,
.IssueLabel,
.timeline-comment-label,
.form-control,
.signed-commit-badge-large,
.signed-commit-badge-medium,
.signed-commit-badge-small,
.btn {
    border-radius: 3px !important;
}

div.border-bottom:nth-child(1) {
    border-bottom: none !important;
}

.Box-row {
    border-bottom: 1px solid #f1f1f1;
    padding-top: 6px !important;
    padding-bottom: 6px !important;
}

.BorderGrid-cell,
.Box-header {
    padding-top: 7px !important;
    padding-bottom: 7px !important;
    border: none !important;
}

.BorderGrid {
    margin-top: 10px;
}

li.mb-2,
p.mt-3,
div.mt-3 {
    margin: 2px !important;
}

li.mb-2 > a:nth-child(1) {
    display: none;
}


h2.mb-3 {
    margin-top: 20px !important;
    margin-bottom: 2px !important;
}

.btn.ml-2 {
    padding: 4px 16px !important;
}

div.px-3:nth-child(1) {
    margin-bottom: 5px !important;
}

div[aria-label="Issues"] > div:first-child > div {
    padding: 0 !important;
}
.pb-3 {
    padding-top: 15px;
}

video,
.ytp-cued-thumbnail-overlay-image,
svg,
img {
    -webkit-filter: invert(1);
    filter: invert(1);
    opacity: 0.8;
}

input,
pre,
button,
body {
    font-family: 'DankMono Nerd Font';
    font-size: 1.1rem;
}
#urls {
    width: 600px;
}
#sidebar {
    opacity: 0.8;
    margin: 3rem 0;
}
#sidebar input[type="submit"] {
    background: none;
    color: black;
    padding: 0;
}
.selectable_url {
    border-radius: 5px;
}

#backToTop,
footer,
.search_filters,
.title {
    display: none !important;
}


.index {
    width: 100vw;
    height: 100vh;
    display: flex;
    justify-content: center;
    align-items: center;
}

#q {
    border-radius: 5px 0 0 5px;
}
#send_search {
    border-radius: 0 5px 5px 0;
}
#search {
    padding: 1em 2em;
}

#pagination button {
    padding: 10px 100px !important;
    margin: 2em !important;
    background: none !important;
    color: black !important;
    text-decoration: underline;
}

#pagination .ion-chevron-right {
    display: none;
}

